import React, { PureComponent } from 'react';
import './App.css';
import axios from 'axios';
import styles from './mystyle.module.css'; 

class VideoPage extends PureComponent {
        componentDidMount = () => {
        this.fetchRecent();
    }

    fetchRecent = () => {
        axios.get('http://localhost:9890/recent')
            .then((response) => {
                this.setState({ recentImage: response.data.image });
            })
            .catch(err => alert('Error: ' + err));
    }

    render() {
        return (

            <div className={styles.Recent}>
            <video src={'http://localhost:9890/image' + window.location.href.split("/video").pop()} className="ListImage__Image"  width = "800" height = "600" controls>
            </video>
                    <div>
                </div>
            </div>
        );
    }
}

export default VideoPage;
